const About = () => {
  return (
    <div className="bg-dark">
<div className='container py-5'>
      <h2>About Me</h2>
      <p>
        Hello! I'm Krishna sai surendra kalluri, Front End Engineer in building
        web based and mobiles based applications using React.js, React-Native
        frameworks. Aware of the advanced HTML5, CSS3, JavaScript, React/Redux,
        Redux Saga, ES6, jQuery, Bootstrap, NodeJS, the Styled Components,
        SASS/LESS CSS Preprocessors, and the Web Service RESTful. I am a driven
        person who enjoys learning new things and learns fast.
      </p>
      <br />
      <p>
        I am really fond of building constructive and efficient solutions. I
        think open-mindedness may assist you to be creative and get insight into
        any subject in your area!
      </p>
    </div>
    </div>

  );
};

export default About;
